import React from 'react';
import '../index.scss';
import Card from './Card/Card';
const Home = () => {
  return (
    <section class="content">
      <h1>Товары</h1>
      <div class="sort">
        <div class="category">Все</div>
        <div class="category">Кроссовки</div>
        <div class="category">Футболки</div>
        <div class="category">Худи</div>
      </div>
      <div class="cards"></div>
    </section>
  );
};

export default Home;
